import DialogBarStyle from './dialogBar.module.css'
import React from 'react'

import {Routes, Route, Link} from 'react-router-dom'
import {DialogBarElem} from './DialogBarElem/DialogBarElem'


export const DialogBar=(props)=>{
    return(
        <>
    <div className={DialogBarStyle.Massage__dialogsBar}>
     {/* <Link to={props.path+props.id}></Link> */}
     <Link to='/DialogBarElem' name='aaa'><DialogBarElem/></Link>
     {/* <Link to={props.path+props.id}><DialogBarElem id='2' name="Dasha" time='14:17' massage='AAAAAAA'/></Link>
     <Link to={props.path+props.id}><DialogBarElem id='3' name="Katya" time='12:22' massage='Mow'/></Link> */}
    </div>

     <Routes>
          <Route  path='/DialogBarElem' element={<DialogBarElem id='1' name="Sasha" time='14:56' massage='Hey! How are u?'/>}/>
      </Routes>
      </>   

    )
}
